export type InitialState<State> = State | (() => State);
export type NextState<State, PreviousState = State> = State | ((previousState: PreviousState) => State);
export declare function resolveHookState<State>(nextState: InitialState<State>): State;
export declare function resolveHookState<State, PreviousState = State>(nextState: NextState<State, PreviousState>, previousState: PreviousState): State;
